public class HackBluetoothPacketsActivity extends AppCompatActivity {
    BluetoothAdapter bluetoothAdapter = BluetoothAdapter.getDefaultAdapter();
    FrameToGlasses connectHelper;

    //White Screen, One Second
    String hexStream1 = "";
    String hexStream2 = "";


    String hexStreamWhite200320 = "";
    String hexStreamRed400640 = "";
    String hexStream100100Icon = "";

    String hexStringEldenRing400640;
    String hexStringTowerOfGod400640;

    public HackBluetoothPacketsActivity() throws IOException {
    }

    //Read from Jpeg




    @Override
    protected void onCreate(Bundle savedInstanceState) {

        AssetManager assetManager = getAssets();
        try {
            String[] files = assetManager.list("");
            for(String s : files) {
                Log.w("Files", s);
            }
            //Can send smaller jpegs, but anything bigger than 400x640 will crash the glasses.
            InputStream input = assetManager.open("towerofgod400640.jpg");
            hexStringTowerOfGod400640 = Hex.encodeHexString(IOUtils.toByteArray(input));
            input = assetManager.open("EldenRing400640.jpg");
            hexStringEldenRing400640 = Hex.encodeHexString(IOUtils.toByteArray(input));

        } catch (IOException e) {
            e.printStackTrace();
        }
        Log.w("Test", "Done");


        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_hack_bluetooth_packets);

        connectHelper = new FrameToGlasses();

        final Button connectBtn = findViewById(R.id.connect_uuid_0);
        final Button sendStream1Button = findViewById(R.id.btn_send_stream_1);
        final Button sendStream2Button = findViewById(R.id.btn_send_stream_2);
        final Button sendStream3Button = findViewById(R.id.btn_send_stream_3);

        connectBtn.setOnClickListener(new View.OnClickListener() {
            public void onClick(View v) {
                //On pressing button, try to connect to Tooz with UUID
                connectHelper.searchAndConnect(connectHelper.MY_UUID);
            }
        });

        sendStream1Button.setOnClickListener(new View.OnClickListener() {
            public void onClick(View v) {
                connectHelper.sendFrame(hexStringEldenRing400640);
            }
        });

        sendStream2Button.setOnClickListener(new View.OnClickListener() {
            public void onClick(View v) {
                connectHelper.sendFrame(hexStringTowerOfGod400640);
            }
        });
        sendStream3Button.setOnClickListener(new View.OnClickListener() {
            public void onClick(View v) {
                connectHelper.sendFrame(hexStream100100Icon);
            }
        });
        //Log.w("Test", test);
    }

    @Override
    protected void onDestroy() {
        super.onDestroy();
    }
}

